import React from 'react'

//data
import { data } from './../data'

//components
import FunctionIcon from './FunctionIcon'

const FunctionUI = ({ leng }) => {
    console.log(leng);


    console.log(data[leng]);

    return (
        <div>

            {data[leng].function.description[0]}
            <FunctionIcon />
            {data[leng].function.description[1]}
        </div>
    )
}

export default FunctionUI;
